import React from "react";
import htmlFoto from './htmlft.png';
import './specifications.css';
import javaFoto from './javascript.jpg'

function Especificacoes () {
    return(

<div className="especificacaoes">

    <div className="espp-content">

     <div className="esp um" ><img id="html" src={htmlFoto}  />
   
     </div>

     <div className="esp dois"> JAVA SCRIPT 
     </div>

     <div className="esp tres">REACT
     </div>

     <div className="esp quatro">NODEJS
     </div>

     <div className="esp cinco">BANCO DE DADOS SQL
     </div>

</div>


</div>
    )
}

export default Especificacoes
